window.bookSummaryJSON = "<p><b><i>I had her and I lost her.</i></b><br> <b><i>That’s what pain and fear does to someone; they make someone run.</i></b><br> <b><i>And Alicia ran far....</i></b><br> <b><i>Taking my heart with her.</i></b></p> <p>We agreed we both had things to work on, but to be honest, I didn’t know how to improve.<br> <i>She did.</i><br> She fought for us. She got stronger. She did what she said.<br> <i>I lied.</i></p> <p>The truth is...I’m not the man she needs me to be.<br> And I don’t know how to be it.<br> I’m hideous. I’m a monster. My face is abnormal.<br> Who could love a man with one eye?<br> Who could love a man that’s... <i>bad on the inside?</i><br> I’m a rotten soul.</p> <p>But she turns this rotten soul into something more.<br> She gives me hope.<br> Until she dares to move on from me.<br> And then all hell breaks loose.<br> Make no mistake, she’s <i>mine</i>.<br> And she’s about to learn what happens when someone pisses off a beast.<br> They become the monster they were born to be.</p> <p>But just as I have her, someone from her past comes looking for something that no longer exists.<br> Wedding bells ring in the distance.<br> And they aren’t mine.<br> No one marries her, but <i>me</i>. <br> <b>I, object.</b></p>"; 
